{"query": "mutation inventoryAdjustQuantities($input: InventoryAdjustQuantitiesInput!) { inventoryAdjustQuantities(input: $input) { userErrors { field message } inventoryAdjustmentGroup { createdAt reason changes { name delta } } } }",
  "variables": {
    "input": {
      "reason": "correction",
      "name": "available",
      "changes": [
        {
          "delta": ${property.new_quantity},
          "inventoryItemId": "${property.inventory_item_id}",
          "locationId": "${header.location_id}"
        }
      ]
    }
  }
}

{"query": "mutation inventoryItemUpdate($id: ID!, $input: InventoryItemInput!) { inventoryItemUpdate(id: $id, input: $input) { inventoryItem{ id tracked } } }",
  "variables": {
    "id": "${property.inventory_item_id}",
    "input": {
    "tracked": true
   }
  }
}

{"query": "mutation ActivateInventoryItem($inventoryItemId: ID!, $locationId: ID!, $available: Int) { inventoryActivate(inventoryItemId: $inventoryItemId, locationId: $locationId, available: $available) { inventoryLevel { id  item { id } location { id } } } }",
  "variables": {
    "inventoryItemId": "${property.inventory_item_id}",
    "locationId": "${header.location_id}",
    "available": ${property.s4_quantity}
  }
}
